    if (!buffer[length]) 

directly in the code.

This is not good, because if we get errno == EINTR we will go into AtLinker.sendResponse() with a count of -1.
This should be:
do {
    count = read(…)
} while(count == -1 && errno == EINTR) ;
if( errno == -1 )
    error    
else if( !count )
    disconnect
else
    ok

Ok I see what you mean.
You're assuming that write will fail or do some partial write all the time. This isn't usually the case on Linux especially for small buffers like this one.

My point of view is that write will succeed and if it fails it'll be only once.

- count == -1 && errno == EINTR : 0 bytes are written so 
  reset count to 0 and retry
- count == -1 && errno != EINTR : failure, just exit
- count == 0 : 0 bytes are written, just exit
- count > 0 : update the size

If we want a successful write for a big size maybe we can write something like this:

int write(int fd, void* buf, size_t size, pthread_mutex_t* lock)
{
    ssize_t rc = 0;
    size_t count = 0;                                                            

    while ( (size) && (rc != size) )
    {
        rc = write(fd, buf, size);
        if (-1 == count && (EINTR == errno))
        {
            continue;
        }
        if (-1 == count)
        {
            LE_ERROR("write failed: %m");
            if (lock)
            {
                pthread_mutex_unlock(lock);
            }
            return -1;
        }
        if (0 <= rc)
        {
            count = rc;
        }
        size -= count;
        buf += count;                                                            

    }
    return 0;                                                                    
}

and we can make it even better, we stat the fd to get the fs block size and do writes in a multiple of the block size

The question is do we really need to implement all of this for a small buffer like atQmiLinker.cmd ?

Should be just 

    while (size)

You've already subtracted off count from size below, so if you've sent all the data size will always be 0 here.

We can name whatever we want. This should be done within the atBinder code. Here we can use a command line argument to pass the path to atQmiLinker at runtime if we start it manually or through the adef file e.g
processes:
{
   run:
   {
      (atQmiLinker "path/to/socket")
   }
}

Why not

    snprintf(cmd, CMD_SIZE, "at%s", dataPtr->at_name);

and similarly below.  Otherwise it needs to be

    snprintf(cmd+size, CMD_SIZE-size, "%s", dataPtr->at_name);

or you risk a size byte overflow.

If errno == EINTR nothing has been sent, so I don't think this should be treated as a success.

IMO code should look something like:

    size_t bufferLen = strlen(atQmiLinkerPtr->cmd);
    const char* bufferPtr = atQmiLinkerPtr->cmd;
    do
    {
        count = write(atQmiLinkerPtr->sockFd, bufferPtr, bufferLen);
        if (count == 0)
        {
            LE_ERROR("wrote 0 bytes");
            pthread_mutex_unlock(&atQmiLInkerPtr->serverMutex);
            return -1;
        }
        else if (count < 0 && errno != EINTR))
        {
            LE_ERROR("write failed: %zd: %m", count);
            pthread_mutex_unlock(&atQmiLinkerPtr->serverMutex);
            return -1;
        }
        else if (count > 0)
        {
            bufferPtr += count;
            bufferLen -= count;
        }
    }
    while (bufferLen > 0);

Really this should be abstracted out into a framework function.  fd_Write() does something like this but (1) is somewhat buggy, and (2) not exposed by the framework.
